  const [showPlants, setShowPlants] = useState(false);

  const handleClick = () => {
    setShowPlants(true);
  };

  return (
    <div className="App">
      {!showPlants ? (
        <div className="landing">
          <div className="overlay">
            <h1>
              Welcome to Paradise Nursery{" "}
              <span role="img" aria-label="leaf">ðŸŒ¿</span>
            </h1>
            <p>
              Explore our collection of plants, pots, and gardening tools.
            </p>
            <button onClick={handleClick}>Buy House Plants</button>
          </div>
        </div>
      ) : (
        <PlantList />
      )}
    </div>
  );
}

export default App;
